    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <Login/>
                    <SideMenu/>
                    {/* {(this.props.location.pathname === '/')? [<Login/>, <SideMenu/>]:
         (this.props.location.pathname === '/profile')? <Profile/> :null}
           */}
                </header>
            </div>
